	int val_midle = arr[size / 2];
	// –º–∞–ª–µ–Ω—å–∫–∏–µ - –≤ –ª–µ–≤—É—é —á–∞—Å—Ç—å
	// –±–æ–ª—å—à–∏–µ –≤ –ø—Ä–∞–≤—É—é —á–∞—Å—Ç—å –º–∞—Å—Å–∏–≤–∞
	int tmp;
	do {
		while (arr[left] < val_midle) left++;
		while (arr[right] > val_midle) right--;
		if (left <= right) {
			
			tmp = arr[left];
			arr[left] = arr[right];
			arr[right] = tmp;
			
			left++;
